import React from 'react';
import {BrowserRouter as Router,Routes,Route,Link} from 'react-router-dom';
import Product from './Product.js';
import People from './People.js';
import logo from './logo.jpg';

function Header(){
	return(
	<Router>
	<div>
		<h4 className="title "><img src={logo}/> Exerevnisi </h4>

	<ul className="nav-links">
		<li>
		<Link  to="/" style={{ color:'black',textDecoration: 'none' }}>Home</Link>
		</li>
		<li>
		<Link exact to="/product" style={{color:'black', textDecoration: 'none' }}>Product</Link>
		</li>
		<li>
		<Link exact to="/people" style={{ color:'black',textDecoration: 'none' }}>People </Link>
		</li>
		<li>
		<Link to="/join us" style={{ color:'black',textDecoration: 'none' }}>Join Us</Link>
		</li>
	</ul>

	<hr/>
   <Routes>
		<Route  path="/product" component={Product}/>
		<Route  path="/people" component={People}/>
	</Routes>	
	</div>
	</Router>

	);
}

export default Header;
